import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Card, Button, Pagination } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function User() {
    const [users, setUsers] = useState([]);
    const [currentPage, setCurrentPage] = useState(1);
    const [totalPages, setTotalPages] = useState(1);
    const [loading, setLoading] = useState(true);

    // Set the number of users per page
    const usersPerPage = 6;

    // Fetch users from the API when the component mounts or page changes
    useEffect(() => {
        fetchUsers(currentPage);
    }, [currentPage]);

    const fetchUsers = async (page) => {
        setLoading(true);
        const token = localStorage.getItem('token'); // Retrieve authentication token
        try {
            const response = await fetch(`http://138.197.99.80:2490/api/users?page=${page}&limit=${usersPerPage}`, {
                method: 'GET',
                headers: { Authorization: `Bearer ${token}` }
            });

            if (response.ok) {
                const data = await response.json(); // Parse the response data
                setUsers(data.users); // Assuming 'users' is an array in the response
                setTotalPages(data.totalPages); // Assuming 'totalPages' is in the response
                setLoading(false);
            } else {
                console.error("Failed to fetch users. Status:", response.status);
            }
        } catch (error) {
            console.error('Error fetching users:', error);
            setLoading(false);
        }
    };

    // Pagination handler
    const handlePageChange = (pageNumber) => {
        setCurrentPage(pageNumber);
    };

    return (
        <div className="min-vh-100 w-100">
            <Container className="mt-5">
                <Row>
                    {loading ? (
                        <Col>
                            <p>Loading users...</p>
                        </Col>
                    ) : (
                        users.map((user) => (
                            <Col md={4} key={user._id}>
                                <Card style={{ marginBottom: '20px' }}>
                                    <Card.Body>
                                        <Card.Title>{user.first_name} {user.last_name}</Card.Title>
                                        <Card.Text><strong>Major:</strong> {user.major}</Card.Text>
                                        <Card.Text><strong>Company:</strong> {user.company}</Card.Text>
                                        <Link to={`/user/${user._id}`}>
                                            <Button variant="primary">View Profile</Button>
                                        </Link>
                                    </Card.Body>
                                </Card>
                            </Col>
                        ))
                    )}
                </Row>

                {/* Pagination */}
                <div className="d-flex justify-content-center mt-4">
                    <Pagination>
                        <Pagination.Prev
                            onClick={() => currentPage > 1 && handlePageChange(currentPage - 1)}
                            disabled={currentPage === 1}
                        />
                        {[...Array(totalPages)].map((_, index) => (
                            <Pagination.Item
                                key={index + 1}
                                active={currentPage === index + 1}
                                onClick={() => handlePageChange(index + 1)}
                            >
                                {index + 1}
                            </Pagination.Item>
                        ))}
                        <Pagination.Next
                            onClick={() => currentPage < totalPages && handlePageChange(currentPage + 1)}
                            disabled={currentPage === totalPages}
                        />
                    </Pagination>
                </div>
            </Container>
        </div>
    );
}

export default User;
